    false,nt"url": null,nt"notes": "The Chignik, Alaska Forecast Grids provides
    bathymetric data strictly for tsunami inundation modeling with the Method of Splitting
    Tsunami (MOST) model. MOST is a suite of numerical simulation codes capable of simulating
    three processes of tsunami evolution: generation, transoceanic propagation, and
    inundation of dry land. Tsunami waves are computationally propagated across a set
    of three nested grids (A, B, and C), each of which is successively finer in resolution,
    moving from offshore to onshore. Nearshore details are resolved to the point that
    model output can be directly compared with tide gauge observations and can provide
    estimates of wave arrival time, wave amplitude and simulation of wave inundation
    onto dry land. A Grid Resolution: 108 arc-sec in x direction, 72 arc-sec in y direction.
    B Grid Resolution: 17.9 arc-sec in x direction, 11.9 arc-sec in y direction. C Grid
    Resolution: 2 arc-sec in x direction, 1 arc-sec in y direction.",nt"license_title":
